import Map from './Map';
import LocationList from './LocationList';

function App() {

    const [pins, setPins] = useState([]);
    useEffect(() => {
        const fetchPins = async () => {
            const res = await fetch(process.env.REACT_APP_SERVER_API_URL + '/pins');
            const pins = await res.json();
            setPins(pins);
        };

        fetchPins();
    }, []);

    return (
        <div className="App">
            <h1>PinMap</h1>
            <Map pins={pins}/>
            <LocationList pins={pins} />
        </div>
    );
}

export default App;
